CREATE TABLE food(
   ID            INTEGER  NOT NULL PRIMARY KEY 
  ,NAME          VARCHAR(127) NOT NULL
  ,ENERGY        INTEGER  NOT NULL 
  ,CARBOHYDRATES DECIMAL(4,1) NOT NULL
  ,FAT           DECIMAL(4,1) NOT NULL
  ,FIBER         DECIMAL(4,1) NOT NULL
  ,PROTEIN       DECIMAL(4,1) NOT NULL
);
